export default function DateTimeToString(date){
    let options = {
        year: 'numeric',
        month: '2-digit',
        day: '2-digit',
        hour: '2-digit',
        minute: '2-digit',
        second: '2-digit'
    }
    let _date = new Date(date);
    let stringDate = _date.toLocaleString('uk', options);
    return stringDate == 'Invalid Date' ? '' : stringDate;
}
